import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Shared/Navbar';
import Footer from './components/Shared/Footer';
import Home from './components/Home/Home';
import DevSignUp from './components/Auth/DevSignUp';
import OrgSignUp from './components/Auth/OrgSignUp';
import Login from './components/Auth/Login';
import DevDashboard from './components/Dashboard/DevDashboard';
import OrgDashboard from './components/Dashboard/OrgDashboard';
import AddPosition from './components/Dashboard/AddPosition';
import AddSkills from './components/Dashboard/AddSkills';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup-developer" element={<DevSignUp />} />
          <Route path="/signup-organization" element={<OrgSignUp />} />
          <Route path="/dashboard-developer" element={<DevDashboard />} />
          <Route path="/dashboard-organization" element={<OrgDashboard />} />
          <Route path="/add-position" element={<AddPosition />} />
          <Route path="/add-skills" element={<AddSkills />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
